import { useState } from 'react';
import Navbar from './components/NavbarForm';
import LandingPage from './pages/LandingPage';
import LoginPage from './pages/LoginPage';
import AppointmentPage from './pages/AppointmentPage';
import TodoPage from './pages/TodoPage';




function App() {
const [user, setUser] = useState({});


  const update =  (data:object):Function => {//this is the function that is passed down to the login page
    console.log(data,);//console logging the data that is passed into the update function

    setUser(data);//state is updated
    return () => (null);
  }
  console.log(user);
  return (
    <div>
      <Navbar />
      <LandingPage />
      <LoginPage update={(data:Object):Function => update(data)} />
      <AppointmentPage />
      <TodoPage />
    </div>
  );
}

export default App;
